import React from 'react';
import './style.css';
/* import BgVideo from "../src/components/BgVideo.jsx"; */
import video from '../src/assets/white_bg.mp4';

function App() {
  return (
    <div className="App">
      <div className="background">
        <video autoPlay muted loop id ="bv">
          <source src={video} type="video/mp4" />
          Your browser does not support the video tag.
        </video>
      </div>
      <main>
        <video autoPlay muted loop id="background-video">
          <source src={video} type="video/mp4" />
          Your browser does not support the video tag.
        </video>
        <section id="intro">
          {/* <BgVideo/> */}
          <h1>Bendareur Ayoub</h1>
          <h3>Etudiant informatique à Epitech Lyon</h3>
          {/* citation */}
        </section>
        {/* Section Présentation */}
        <section id="presentation">
          <h1>Présentation :</h1>
          <ul>
            <li>Bendareur Ayoub</li>
            <li>ayoub.bendareur@epitech.eu</li>
            <li>Vaulx-En-Velin</li>
            {/* <li>06 66 88 23 96</li> */}
          </ul>
        </section>
        {/* Section Liste */}

        <section id="competence">
          <h2>Compétences :</h2>
          <ul>
            <li>Langages de programmation : C, Python, JavaScript, HTML, CSS, PHP, SQL</li>
            <li>Framework : React, Node.js,</li>
            <li>Logiciels : Visual Studio Code, Git, GitHub, </li>
            <li>Langues : Français , Anglais (B2)</li>
          </ul>
        </section>

        <section id="projets">
          <h2>Projets réalisé durant l'année</h2>
          <ul>
            <li>Minishell2</li> {/* Un popup sur le projet */}
            <li>My_RPG</li> {/* Un popup sur le projet */}
            <li>Need4Stek</li> {/* Un popup sur le projet */}
            <li>My_Sokoban</li> {/* Un popup sur le projet */}
            <li>Pong</li> {/* Un popup sur le projet */}
            <li>Portfolio</li> {/* Un popup sur le projet */}
            <li>Bot Discord</li> {/* Un popup sur le projet */}
          </ul>
        </section>
        <section id="experiences">
          <h2>Expérience professionnel</h2>
          <h1>Parcours :</h1>
          <ul>
            {/* Parcours scolaire, Parcours professionnel, Etc… */}
            <li>2021-2023 : Baccalauréat Scientifique</li>
            <li>2023-2028 : Epitech Lyon</li>
          </ul>
        </section>
        <section id="contact">
          <h2>Contact :</h2>
          <ul>
            <li>LinkedIn</li>
            <li>GitHub</li>
            <li>Mail</li>
          </ul>
        </section>
      </main>
      <script src="app.js"></script> {/* Inclusion du fichier JavaScript */}
    </div>
  );
}

export default App;
